      <ul>
        {props.users.map((user) => (
          <User
            key={user.id}
            id={user.id}
            name={user.name}
            age={user.age}
            email={user.email}
          >    <p> <b>Name:</b> {props.name} </p>
          <p><b>Age:</b> ({props.age} years old)</p>
          <p><b>Email:</b> {props.email}</p>
          <button type="button" onClick={deleteUser}>Delete</button></User>
        ))}
      </ul>
    </Card>
  );
};

